info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of GitLab GitLab
  title: GitLab GitLab
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Get commit details from project ID and commit hash
      parameters:
      - description: Project name
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Username of project owner
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: Issue number to add a comment to
        example: ''
        in: body
        name: Issue Number
        required: true
        schema: {type: string}
      - description: Comment text body
        example: ''
        in: query
        name: Comment Body
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: GitLab Add Comment To Issue
  tmp1:
    post:
      description: Delete a branch from GitLab
      parameters:
      - description: Project name to delete a branch from
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Owner of the project's username
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: Name of the branch to delete
        example: ''
        in: query
        name: Branch Name
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: GitLab Delete Branch
  tmp10:
    post:
      description: Edit a pull request in a project
      parameters:
      - description: Project name
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Username of project owner
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: Number of the PR to edit
        example: ''
        in: body
        name: Pull Request Number
        required: true
        schema: {type: string}
      - description: If not blank will update the PR title
        example: ''
        in: query
        name: PR Title
        required: false
        schema: {type: string}
      - description: If not blank will update the PR description
        example: ''
        in: query
        name: PR Description
        required: false
        schema: {type: string}
      - description: Comma separated values of the labels that if not blank, will
          update the PR labels
        example: ''
        in: query
        name: PR Labels
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp10'}
          description: Successful request
      summary: GitLab Edit Pull Request
  tmp2:
    post:
      description: Get commit details from project ID and commit hash
      parameters:
      - description: Project ID to search for the commit
        example: ''
        in: query
        name: Project ID
        required: true
        schema: {type: string}
      - description: SHA256 Hash ID of the commit to get
        example: ''
        in: query
        name: Commit ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: GitLab Get Commit By ID
  tmp3:
    post:
      description: Get the raw data from a file in a project
      parameters:
      - description: Project name
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Username of project owner
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: File path, relative to project root, of the file to get the raw
          contents of
        example: ''
        in: query
        name: File Path
        required: true
        schema: {type: string}
      - description: Name of branch to get the file from, will default to 'master'
          if not set
        example: ''
        in: query
        name: Branch Name
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: GitLab Get File Content
  tmp4:
    post:
      description: Get issue comments from a project
      parameters:
      - description: Project name
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Username of project owner
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: Number of the issue to get comments from
        example: ''
        in: body
        name: Issue Number
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp4'}
          description: Successful request
      summary: GitLab Get Issue Comments
  tmp5:
    post:
      description: Get issue(s) from a project
      parameters:
      - description: Project name
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Username of project owner
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: Number of the issue to get, if blank, will return all issues
          for the project
        example: ''
        in: body
        name: Issue Number
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp5'}
          description: Successful request
      summary: GitLab Get Issue(s)
  tmp6:
    post:
      description: Get pull request(s) from a project
      parameters:
      - description: Project name
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Username of project owner
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: Optional pull request number to get info about, if blank will
          return all
        example: ''
        in: body
        name: Pull Request Number
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp6'}
          description: Successful request
      summary: GitLab Get Pull Request(s)
  tmp7:
    post:
      description: Get commit history from username
      parameters:
      - description: Username to get commit history of
        example: ''
        in: query
        name: Username
        required: true
        schema: {type: string}
      - description: Number of results to get, maximum. For best efficiency, use multiples
          of 20
        example: ''
        in: query
        name: Max Results
        required: true
        schema: {type: string}
      - description: ISO-8601 format datestring to start the commit history from,
          going backwards in time. Blank for now
        example: ''
        in: query
        name: Start Date
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp7'}
          description: Successful request
      summary: GitLab Get Commit History By Username
  tmp8:
    post:
      description: Create an issue in a project
      parameters:
      - description: Project name
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Username of project owner
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: Title of the new issue to be created
        example: ''
        in: query
        name: Issue Title
        required: true
        schema: {type: string}
      - description: Description for the new issue to be created
        example: ''
        in: query
        name: Issue Description
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp8'}
          description: Successful request
      summary: GitLab Create Issue
  tmp9:
    post:
      description: Edit an issue in a project
      parameters:
      - description: Project name
        example: ''
        in: query
        name: Project Name
        required: true
        schema: {type: string}
      - description: Username of project owner
        example: ''
        in: query
        name: Project Owner
        required: true
        schema: {type: string}
      - description: Number of the issue to edit
        example: ''
        in: body
        name: Issue Number
        required: true
        schema: {type: string}
      - description: If not blank will update the issue title
        example: ''
        in: query
        name: Issue Title
        required: false
        schema: {type: string}
      - description: If not blank will update the issue description
        example: ''
        in: query
        name: Issue Description
        required: false
        schema: {type: string}
      - description: Comma separated values of the labels for the issue
        example: ''
        in: query
        name: Issue Labels
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp9'}
          description: Successful request
      summary: GitLab Edit Issue
tags:
- {name: DevOps & Application Security}
